import React from "react";

class TopNews extends React.Component{
    render(){
        return(
            <div class="container-fluid">
                <div class="row flex-nowrap">
                    <div class="col-3">
                        <div class="card card-block">Card</div>
                    </div>
                </div>
            </div>
        );
    }
}

export default TopNews;
